function cancelFullScreen(el)
{
    var requestMethod = el.cancelFullScreen||el.webkitCancelFullScreen||el.mozCancelFullScreen||el.exitFullscreen;
    if (requestMethod) { // cancel full screen.
        requestMethod.call(el);
    } else if (typeof window.ActiveXObject !== "undefined") { // Older IE.
        var wscript = new ActiveXObject("WScript.Shell");
        if (wscript !== null) {
            wscript.SendKeys("{F11}");
        }
    }
}

function requestFullScreen(el)
{
    var el = document.documentElement
    , rfs = // for newer Webkit and Firefox
           el.requestFullScreen
        || el.webkitRequestFullScreen
        || el.mozRequestFullScreen
        || el.msRequestFullscreen
    ;
    if(typeof rfs!="undefined" && rfs)
    {
      rfs.call(el);
    }
    else if(typeof window.ActiveXObject!="undefined"){
      // for Internet Explorer
      var wscript = new ActiveXObject("WScript.Shell");
      if (wscript!=null) {
         wscript.SendKeys("{F11}");
      }
    }
}

function toggleFull()
{
    var elem = document.body; // Make the body go full screen.
    var isInFullScreen = (document.fullScreenElement && document.fullScreenElement !== null) ||  (document.mozFullScreen || document.webkitIsFullScreen);

    if (isInFullScreen) {
        cancelFullScreen(document);
    } else {
        requestFullScreen(elem);
    }
    return false;
}

function removeShade()
{
    fsn('#pop_shade').remove();
}

function reloadWindow()
{
    window.location.reload(true);
}

function Logout()
{
    fsn.http({
      url:'/tripklehotels_beta/',
      data:'&cortex=UserLogout',
      requestMethod:'POST',
      contentType:"url-encode",
      progressType:'Progressbar',
      ProgressContainer:'PageLoadContainer',
      Progressbar:'PageLoadProgress',
      success:function(data)
      {
        console.log(data);
        var obj = JSON.parse(data);
        if(obj['status'])
        {
            window.location.reload(true);
        }
      }
    });
}

window.onclick = function(event)
{
    if(event.target.id == 'pop_shade')
    {
        fsn('#pop_shade').remove();
    }
};